import React from "react";
import { View, Image, StyleSheet, FlatList } from "react-native";
import movies from "../assets/data/videos";

const clips = movies.movies[0];

function Carousel(props) {
  return (
    // <View style={styles.container}>
    <View style={styles.carousel}>
      <Image source={require("../assets/redline-horizontal.png")} />
      <FlatList
        data={clips}
        renderItem={({ item }) => (
          <Image source={require("../assets/clip.png")} style={styles.clip} />
        )}
      />

      <Image source={require("../assets/redline-horizontal.png")} />
    </View>
    // </View>
  );
}

const styles = StyleSheet.create({
  container: {
    // flex: 1,
    width: "80%",
    justifyContent: "center",
    resizeMode: "contain",
  },
  carousel: {
    flexDirection: "row",
    width: "80%",
  },

  clip: {
    marginTop: 10,
    // width: "100%",
    // height: "auto",
  },
});

export default Carousel;
